import React from "react";
import "../../Pages/Signup/signup.css";

export const Input = ({ type, placeholder, header, value, setter }) => {
  return (
    <div className="bg-red-400 flex flex-col">
      <h1 className=" ml-3 font-semibold text-left text-sm content">
        {header}
      </h1>
      <input
        type={type}
        className="text-left w-2/3 h-12 rounded-2xl mb-5 pl-5 italic focus:outline-none"
        placeholder={placeholder}
        value={value}
        onChange={(e) => {
          setter(e.target.value);
        }}
      />
    </div>
  );
};
